[{"location":"#HarmonicPowerModels.jl-Documentation","page":"Home","title":"HarmonicPowerModels.jl Documentation","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"CurrentModule = HarmonicPowerModels","category":"page"},{"location":"#Overview","page":"Home","title":"Overview","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"HarmonicPowerModels.jl is a research-grade Julia/JuMP package for experimentation with Steady-State Power Network Optimization with Harmonics, extending PowerModels.jl.","category":"page"},{"location":"#Installation","page":"Home","title":"Installation","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"For now, HarmonicPowerModels is unregistered. Nevertheless, you can install it through","category":"page"},{"location":"","page":"Home","title":"Home","text":"] add https://github.com/timmyfaraday/HarmonicPowerModels.jl.git","category":"page"},{"location":"","page":"Home","title":"Home","text":"At least one solver is required for running PowerModels.  The open-source solver Ipopt is recommended, as it is fast, scaleable and can be used to solve a wide variety of the problems and network formulations provided in PowerModels.  The Ipopt solver can be installed via the package manager with","category":"page"},{"location":"","page":"Home","title":"Home","text":"] add Ipopt","category":"page"},{"location":"","page":"Home","title":"Home","text":"Test that the package works by running","category":"page"},{"location":"","page":"Home","title":"Home","text":"] test HarmonicPowerModels","category":"page"},{"location":"xfmr/#Transformer-Model","page":"Transformer","title":"Transformer Model","text":"","category":"section"},{"location":"xfmr/#","page":"Transformer","title":"","text":"","category":"section"},{"location":"xfmr/#Transformer-Excitation","page":"Transformer","title":"Transformer Excitation","text":"","category":"section"},{"location":"xfmr/#Theoretical-Background","page":"Transformer","title":"Theoretical Background","text":"","category":"section"},{"location":"xfmr/","page":"Transformer","title":"Transformer","text":"In the time domain, the transformer excitation voltage~e(t)\\,[V] and magnetization current~i^m(t)\\,[A] are related through the BH-curve:","category":"page"},{"location":"xfmr/","page":"Transformer","title":"Transformer","text":"beginalign\n    e(t) rightarrow B(t) stackrelmboxBH-curverightarrow H(t) rightarrow i^m(t)\nendalign","category":"page"},{"location":"xfmr/","page":"Transformer","title":"Transformer","text":"Illustration of the relationship between the excitation voltage~e(t) and magnetization current~i^m(t)","category":"page"},{"location":"xfmr/","page":"Transformer","title":"Transformer","text":"The transformer excitation voltage~e(t) relates to its magnetic flux density~B(t)\\,[T]:","category":"page"},{"location":"xfmr/","page":"Transformer","title":"Transformer","text":"beginalign\n    B(t)    = sum_h in H fracE_hA cdot omega_h cdot cos(omega_h cdot t + theta_h) \n    mboxgiven  nonumber \n    e(t)    = sum_h in H E_h cdot sin(omega_h cdot t + theta_h) \n    B(t)    = frac1A int -e(t) mathrmdt\nendalign","category":"page"},{"location":"xfmr/","page":"Transformer","title":"Transformer","text":"where~A\\,[m^2], omega_h\\,[rad/Hz], E_h\\,[V] and~theta_h\\,[rad] denotes the core surface, harmonic angular frequency, harmonic excitation voltage magnitude and phase angle, respectively. The link between the frequency-domain excitation current~E\\,[pu] and the time-domain excitation voltage~e(t), and consequently the magnetic flux density~B(t), is provided through the following functions, depending on the chosen excitation voltage formulation E_formulation, i.e., :polar or :rectangular.","category":"page"},{"location":"xfmr/","page":"Transformer","title":"Transformer","text":"HarmonicPowerModels.magnetic_flux_density_polar(E::Vector{<:Real}, θ::Vector{<:Real}, ω::Vector{<:Real}, t::Vector{<:Real}, A::Real, Vbase::Real)","category":"page"},{"location":"xfmr/","page":"Transformer","title":"Transformer","text":"HarmonicPowerModels.magnetic_flux_density_rectangular(Ere::Vector{<:Real}, Eim::Vector{<:Real}, ω::Vector{<:Real}, t::Vector{<:Real}, A::Real, Vbase::Real)","category":"page"},{"location":"xfmr/","page":"Transformer","title":"Transformer","text":"The transformer magnetization current~i^m(t) relates to its magnetic field intensity~H(t)\\,[Ampere-turn/meter]:","category":"page"},{"location":"xfmr/","page":"Transformer","title":"Transformer","text":"beginalign\n    i^m(t)  = H(t) cdot l\nendalign","category":"page"},{"location":"xfmr/","page":"Transformer","title":"Transformer","text":"where~l\\,[m] denotes the mean magnetic path. The frequency-domain magnetization current~I^e\\,[pu] is determined through a Fourrier transform of the time-domain magnetization current~i^m(t), adjusted for current basis. Depending on the chosen excitation voltage formulation E_formulation, the frequency-domain magnetization current is expressed in :polar or :rectangular coordinates.","category":"page"},{"location":"xfmr/#Implementation","page":"Transformer","title":"Implementation","text":"","category":"section"},{"location":"xfmr/","page":"Transformer","title":"Transformer","text":"    HarmonicPowerModels.sample_xfmr_excitation(data::Dict{String, <:Any}, xfmr_exc::Dict{Int, Dict{String, <:Any})","category":"page"},{"location":"xfmr/","page":"Transformer","title":"Transformer","text":"All excitation data are stored in a dictionary xfmr_exc with:","category":"page"},{"location":"xfmr/","page":"Transformer","title":"Transformer","text":"key = id of the xfmr [Int]\nval = a dictionary consisting of three types of input:\nGeneral input, including:","category":"page"},{"location":"xfmr/","page":"Transformer","title":"Transformer","text":"key type description\nE_formulation Symbol excitation voltage formulation, i.e., :rectangular or :polar\nI_formulation Symbol magnetization current formulation, i.e., :rectangular or :polar\nE_harmonics Vector{Int} set of excitation voltage harmonics\nI_harmonics Vector{Int} set of magnetization current harmonics","category":"page"},{"location":"xfmr/","page":"Transformer","title":"Transformer","text":"Magnetization model input, including:","category":"page"},{"location":"xfmr/","page":"Transformer","title":"Transformer","text":"key type description\nBH_curve Function anonymous function for the inversed BH-curve [T//A-turns/m]\nmean_path Real mean magnetic path [m]\ncore_surface Real core surface [m^2]","category":"page"},{"location":"xfmr/","page":"Transformer","title":"Transformer","text":"Excitation voltage input, depending on the chosen E_formulation:","category":"page"},{"location":"xfmr/","page":"Transformer","title":"Transformer","text":"if Eformulation == :rectangular | key           | type          | description                                                                       | |–––––––-|–––––––-|–––––––––––––––––––––––––––––––––––––––––-| | dEre          | Vector{Real}  | real excitation voltage step [pu] for all excitation voltage harmonics            | | Eremin       | Vector{Real}  | minimum real excitation voltage [pu] for all excitation voltage harmonics         | | Eremax       | Vector{Real}  | maximum real excitation voltage [pu] for all excitation voltage harmonics         | | dEim          | Vector{Real}  | imaginary excitation voltage step [pu] for all excitation voltage harmonics       | | Eimmin       | Vector{Real}  | minimum imaginary excitation voltage [pu] for all excitation voltage harmonics    | | Eimmax       | Vector{Real}  | maximum imaginary excitation voltage [pu] for all excitation voltage harmonics    |       if Eformulation == :polar | key           | type          | description                                                                       | |–––––––-|–––––––-|–––––––––––––––––––––––––––––––––––––––––-| | dE            | Vector{Real}  | excitation voltage magnitude step [pu] for all excitation voltage harmonics       | | dEmin        | Vector{Real}  | minimum excitation voltage magnitude [pu] for all excitation voltage harmonics    | | dEmax        | Vector{Real}  | maximum excitation voltage magnitude [pu] for all excitation voltage harmonics    | | dθ            | Vector{Real}  | excitation voltage phase angle step [rad] for all excitation voltage harmonics    | | dθmin        | Vector{Real}  | minimum excitation voltage phase angle [rad] for all excitation voltage harmonics | | dθmax        | Vector{Real}  | maximum excitation voltage phase angle [rad] for all excitation voltage harmonics |","category":"page"}]
